import React from "react";

export default function InputBox({ value, onChange }) {
  return (
    <textarea
      value={value}
      onChange={(e) => onChange(e.target.value)}
      placeholder="Ask your question..."
      rows={3}
      style={{ width: "100%", padding: "10px" }}
    />
  );
}
